import React from 'react'
import './../components/ListCours.css'
import DataSlidebar from '../DataSlidebar.json'


export default function ListCours(props) {
    
    
    if (props.pth==="/"){
        return (
            <div>
              <div>
                
                <div className="list-cours mt-5">
                  <ol>
                                {DataSlidebar.PremierAc.map((it) => 
                                <li><a>{it.title}</a></li>
                                )}
                  </ol>
                </div>
              </div>
            </div>
          )
        }

    if (props.pth==="/PremierAcCours"){
        return (
            <div>
              <div>
                
                <div className="list-cours mt-5">
                  <ol>
                                {DataSlidebar.DeuxiemeAc.map((it) => 
                                <li><a>{it.title}</a></li>
                                )}
                  </ol>
                </div>
              </div>
            </div>
        )
        }

}
